import axios from "axios";
import React, { useState, useEffect } from "react";


const StudentProfile = (props) => {
  const [isLoading, SetisLoading] = useState(false);

  useEffect(() => {
    SetisLoading(true);
    fetch('http://localhost:8080/Student', {
        mode: 'no-cors',
        method: 'GET',
        headers: {
            Authorization:"Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJtb2UiLCJpYXQiOjE2MjEwNjc3MTcsImV4cCI6MTYyMTA3NDkxN30.iOn18Sy8oaAGtZTYPfZnoFs5qLkMuBa4uUksrr2NLJs"
        }
    })
      .then((res) => {
        SetisLoading(false);
        console.log(res);
      })
      .catch((error) => {
        SetisLoading(false);
        console.log(error);
      });
  }, []);

  return (
    <div>
      Student profile
      {isLoading && <p>Obtaining data...</p>}
    </div>
  );
};

export default StudentProfile;
